settings.labelFunction:
var status = data['status'];
var color = '#1F8B4D';
switch (status) { 
    case 'On route':
        color = "#1F8B4D";
        break;
    case 'At the stop':
        color = "#D4C21B";
        break;
    case 'Refueling':
        color = "#4A8AEC";
        break;
    case 'Broken':
        color = "#E64A19";
        break;
    default:
        break;
}

return '<div style="border-radius: 15px; border: solid #ffffff 2px; background-color: #fff; padding: 3px 0px 3px 0px;"><span style="border: solid ' + color + ' 2px; border-radius: 15px; color: ' + color + '; padding: 4px 12px 4px 12px; font-size: 14px; font-weight: 600;">' + 
           '${entityName}' + 
        '</span></div>';

settings.tooltipFunction:
var deviceType = dsData[dsIndex]['Type'];
if (typeof deviceType !== undefined) {
    if (deviceType == "energy meter") {
        return '<b>${entityName}</b><br/><b>Energy:</b> ${energy:2} kWt<br/>';
    } else if (deviceType == "thermometer") {
        return '<b>${entityName}</b><br/><b>Temperature:</b> ${temperature:2} °C<br/>';
    }
}

settings.markerImageFunction:
var status = data['status'];
var index = 0;
switch (status) { 
    case 'On route':
        index = 0;
        break;
    case 'At the stop':
        index = 1;
        break;
    case 'Refueling':
        index = 2;
        break;
    case 'Broken':
        index = 3;
        break;
    default:
        break;
}
var res = {
    url: images[index],
    size: 60  
};
return res;

